Commit:
Don't record the hash arg when it has no explicit braces

this allows for calls like
  some_call(a: 1,
            b: 2
           )

to come out like
  some_call(a: 1,  # => 1
            b: 2   # => 2
           )       # => result

instead of like
  some_call(a: 1,  # => 1
            b: 2   # => {a: 1, b: 2}
           )       # => result
